import React from 'react'
import LineChart from '@mui/material/Box';
function Chart() {
  return (
    <div>
        <LineChart
            xAxis={[{ data: [1, 2, 3, 5, 8, 10] }]}
            series={[
                {
                    data: [2, ],
                },
            ]}
            width={500}
            height={300}
        />
    </div>
  )
}

export default Chart
